import './App.css';
import React, { useState } from 'react';


function App() {
  const [nom,setNom]=useState('bob')

  const modifNom=()=>{
    const nom='Patrice'
    setNom({nom})

  }

  return (
    <div className="App">
      <p>{nom}</p>
      <button onClick={modifNom}></button>
    </div>
  );
}

export default App;
